import React from "react";
import styled from "styled-components";
import { Wrapper } from "../styled/space";
import { Labor, PopUpTitle } from "../styled/typos";
const PopUp = props => {
  console.log(props);
  return (
    <Container>
      <BlueWrapper>
        <PopUpTitle>{props.content.title}</PopUpTitle>
        <Labor isWhite>{props.content.content}</Labor>
        <Labor isWhite>
          <a href={props.content.link.url}> {props.content.link.label}</a>
        </Labor>
      </BlueWrapper>
    </Container>
  );
};

export default PopUp;

const BlueWrapper = styled(Wrapper)`
  background-color: ${props => props.theme.colors.blue};
`;
const Container = styled.div`
  background-color: ${props => props.theme.colors.blue};
  position: fixed;
  z-index: 300;
  top: 0;
  left: 0;
  width: 100%;
  padding: 30px 0;
`;
